import React, {useState} from "react";
import {Box, TextField} from "@mui/material";

const App = () => {
    const [input,setInput] = useState('');
    return (
        <Box>
            <TextField
            label = "New todos"
            varient = "outlined"
            value = {input}
            onChange={(e) => setInput(e.target.value)}
            />
        </Box>
    );
}

export default App;
